/**
 * @name WizzDiscord
 * @author Xor
 * @description V16 - Panneau de gestion visuel et Mode "Tout le monde".
 * @version 1.16.0
 * @website https://github.com/1posix/discord-wizz
 * @source https://github.com/1posix/discord-wizz/blob/master/WizzDiscord.plugin.js
 * @updateUrl https://raw.githubusercontent.com/1posix/discord-wizz/refs/heads/master/WizzDiscord.plugin.js
 */

const fs = require("fs");
const path = require("path");

module.exports = class WizzDiscord {

    constructor() {
        this.styleId = "wizz-style-raw";
        
        // ================= ZONE AUDIO =================
        this.wizzBase64 = ""; // <--- REMET TON SON ICI
        this.audio = new Audio(`data:audio/mp3;base64,${this.wizzBase64}`);
        this.audio.volume = 0.5;
        // ==============================================

        // Path Finder Linux
        try {
            const home = process.env.HOME || process.env.USERPROFILE;
            const possiblePath = path.join(home, ".config", "BetterDiscord", "plugins");
            if (fs.existsSync(possiblePath)) {
                this.configPath = path.join(possiblePath, "wizz_settings.json");
            } else {
                this.configPath = path.join(home, "wizz_settings.json");
            }
        } catch(e) { console.error(e); }

        this.defaultSettings = { allowedUsers: "", cooldown: 5000, allowEveryone: false };
        this.settings = this.defaultSettings; 
        
        this.patchMenu = this.patchMenu.bind(this); 
    }

    start() {
        this.loadSettings();
        this.injectCSS();
        
        const WebpackModules = BdApi.Webpack.getModule((m) => m.dispatch && m.subscribe);
        if (WebpackModules) {
            this.Dispatcher = WebpackModules;
            this.handleMessage = this.handleMessage.bind(this);
            this.Dispatcher.subscribe("MESSAGE_CREATE", this.handleMessage);
        }

        this.unpatch = BdApi.ContextMenu.patch("user-context", this.patchMenu);
        
        const UserStore = BdApi.Webpack.getModule(m => m.getCurrentUser);
        if(UserStore) {
            const user = UserStore.getCurrentUser();
            if(user) this.myId = user.id;
        }
    }

    getSettingsPanel() {
        const panel = document.createElement("div");
        panel.style.padding = "10px";
        panel.style.color = "#fff";

        const title = document.createElement("h2");
        title.innerText = "Gestion du Wizz - Control Center";
        title.style.borderBottom = "1px solid #444";
        title.style.marginBottom = "20px";
        panel.appendChild(title);

        const toggleContainer = document.createElement("div");
        toggleContainer.style.marginBottom = "20px";
        toggleContainer.style.display = "flex";
        toggleContainer.style.alignItems = "center";

        const checkbox = document.createElement("input");
        checkbox.type = "checkbox";
        checkbox.checked = this.settings.allowEveryone;
        checkbox.style.marginRight = "10px";
        checkbox.style.transform = "scale(1.5)";
        
        checkbox.onchange = (e) => {
            this.settings.allowEveryone = e.target.checked;
            this.saveSettings();
            this.showNotification(
                this.settings.allowEveryone ? " Mode Global ACTIV" : " Mode Whitelist ACTIV",
                this.settings.allowEveryone ? "#FAA61A" : "#43b581"
            );
        };

        const label = document.createElement("label");
        label.innerText = "Mode 'Tout le monde' (Dsactive la Whitelist)";
        label.style.fontWeight = "bold";

        toggleContainer.appendChild(checkbox);
        toggleContainer.appendChild(label);
        panel.appendChild(toggleContainer);

        const listTitle = document.createElement("h3");
        listTitle.innerText = "Utilisateurs Autoriss (Whitelist)";
        listTitle.style.marginTop = "20px";
        panel.appendChild(listTitle);

        const listContainer = document.createElement("div");
        listContainer.style.display = "flex";
        listContainer.style.flexWrap = "wrap";
        listContainer.style.gap = "10px";
        listContainer.style.background = "#2f3136";
        listContainer.style.padding = "10px";
        listContainer.style.borderRadius = "5px";
        listContainer.style.minHeight = "50px";

        const ids = this.settings.allowedUsers.split(",").map(s => s.trim()).filter(s => s);
        
        if(ids.length === 0) {
            listContainer.innerText = "Aucun utilisateur whitelist.";
            listContainer.style.color = "#777";
            listContainer.style.fontStyle = "italic";
        } else {
            ids.forEach(id => {
                const tag = document.createElement("div");
                tag.style.background = "#00BFFF";
                tag.style.color = "#000";
                tag.style.padding = "5px 10px";
                tag.style.borderRadius = "15px";
                tag.style.fontWeight = "bold";
                tag.style.display = "flex";
                tag.style.alignItems = "center";
                tag.innerText = id;

                const removeBtn = document.createElement("span");
                removeBtn.innerText = "";
                removeBtn.style.marginLeft = "8px";
                removeBtn.style.cursor = "pointer";
                removeBtn.style.color = "#fff";
                removeBtn.style.background = "rgba(0,0,0,0.3)";
                removeBtn.style.borderRadius = "50%";
                removeBtn.style.width = "18px";
                removeBtn.style.height = "18px";
                removeBtn.style.display = "inline-flex";
                removeBtn.style.justifyContent = "center";
                removeBtn.style.alignItems = "center";
                removeBtn.style.fontSize = "10px";

                removeBtn.onclick = () => {
                    this.toggleUser(id, "ID " + id);
                    tag.remove();
                };

                tag.appendChild(removeBtn);
                listContainer.appendChild(tag);
            });
        }

        panel.appendChild(listContainer);
        return panel;
    }

    showNotification(text, color = "#43b581") {
        const toast = document.createElement("div");
        toast.className = "wizz-toast";
        toast.innerText = text;
        toast.style.borderColor = color;
        document.body.appendChild(toast);
        setTimeout(() => toast.style.opacity = "1", 10);
        setTimeout(() => {
            toast.style.opacity = "0";
            setTimeout(() => toast.remove(), 500);
        }, 3000);
    }

    patchMenu(menu, { user }) {
        if (!user) return; 
        const isWhitelisted = this.settings.allowedUsers.includes(user.id);
        const item = BdApi.ContextMenu.buildItem({
            type: "text",
            label: isWhitelisted ? " Wizz: Bloquer" : " Wizz: Autoriser",
            danger: isWhitelisted, 
            onClick: () => { this.toggleUser(user.id, user.username); }
        });
        menu.props.children.splice(1, 0, item);
    }

    toggleUser(userId, username) {
        let currentList = this.settings.allowedUsers.split(",").map(s => s.trim()).filter(s => s);
        
        if (currentList.includes(userId)) {
            currentList = currentList.filter(id => id !== userId);
            this.showNotification(`${username} retir du Wizz !`, "#f04747"); 
        } else {
            currentList.push(userId);
            this.showNotification(`${username} ajout au Wizz !`, "#43b581");
        }

        this.settings.allowedUsers = currentList.join(",");
        this.saveSettings();
    }

    loadSettings() {
        try {
            if (fs.existsSync(this.configPath)) {
                const raw = fs.readFileSync(this.configPath, "utf8");
                const data = JSON.parse(raw);
                this.settings = { ...this.defaultSettings, ...data };
            } else {
                this.saveSettings(); 
            }
        } catch (e) { this.settings = this.defaultSettings; }
    }

    saveSettings() {
        try {
            fs.writeFileSync(this.configPath, JSON.stringify(this.settings, null, 4));
        } catch(e) { console.error("[Wizz] Save Error", e); }
    }

    injectCSS() {
        const css = `
            @keyframes msn-shake {
                0% { transform: translate(0, 0) rotate(0deg); }
                10%, 30%, 50%, 70%, 90% { transform: translate(-10px, -10px) rotate(-1deg); }
                20%, 40%, 60%, 80% { transform: translate(10px, 10px) rotate(1deg); }
                100% { transform: translate(0, 0) rotate(0deg); }
            }
            .wizz-effect {
                animation: msn-shake 0.5s cubic-bezier(.36,.07,.19,.97) both;
                border: 4px solid #00BFFF !important; position: absolute; top: 0; left: 0; right: 0; bottom: 0;
                pointer-events: none; z-index: 9999;
            }
            .wizz-toast {
                position: fixed; bottom: 20px; left: 50%; transform: translateX(-50%);
                background-color: #202225; color: #fff; padding: 10px 20px;
                border-radius: 5px; border: 1px solid; font-weight: bold; z-index: 10000;
                opacity: 0; transition: opacity 0.3s ease; box-shadow: 0 4px 15px rgba(0,0,0,0.5);
                pointer-events: none;
            }
        `;
        const style = document.createElement("style");
        style.id = this.styleId;
        style.innerText = css;
        document.head.appendChild(style);
    }

    handleMessage(event) {
        try {
            if (!this.myId || !event || !event.message) return;
            const msg = event.message;

            const allowEveryone = this.settings.allowEveryone;

            const rawList = this.settings.allowedUsers || "";
            const isWhitelisted = rawList.includes(msg.author.id);

            if (!allowEveryone && !isWhitelisted) return;

            const isMentioned = msg.mentions && msg.mentions.some(u => u.id === this.myId);

            if (isMentioned) {
                const now = Date.now();
                if (now - this.lastWizz < this.settings.cooldown) return;
                
                this.lastWizz = now;
                this.triggerWizz();
            }
        } catch(e) {}
    }

    triggerWizz() {
        const body = document.body;
        if(body.classList.contains("wizz-effect")) return;
        try { this.audio.currentTime = 0; this.audio.play(); } catch(e) {}
        body.classList.add("wizz-effect");
        setTimeout(() => body.classList.remove("wizz-effect"), 550);
    }

    stop() {
        if (this.Dispatcher) this.Dispatcher.unsubscribe("MESSAGE_CREATE", this.handleMessage);
        if (this.unpatch) this.unpatch(); 
        const style = document.getElementById(this.styleId);
        if (style) style.remove();
        document.querySelectorAll(".wizz-toast").forEach(e => e.remove());
        document.body.classList.remove("wizz-effect");
    }
};
